(let [result (ms/density ms/nodes ms/contacts t0 tmax :time)
      dat {:time (keys result)
           :count (map :mean (vals result))
           :semax (map #(+ (:mean %) (:sd %)) (vals result))
           :semin (map #(- (:mean %) (:sd %)) (vals result))}
      ]
  (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :time :count]]
         [:geom_errorbar [:aes {:ymin :semin :ymax :semax }] {:width 0.68 :color "grey"}]
         [:geom_line {:stat "identity" :color "steelblue"}]
         [:geom_point {:color "steelblue"}]
         [:xlab "Time of day"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle "Density time distribution"])]
      {:width 7 :height 6}))
