  (let[result (ms/contact-latency ["replies"] t0 tmax :time)
       dat {:hour (mapcat keys (vals result))
            :count (map :mean (mapcat vals (vals result)))
            
            :semin (map #(let [vmin (- (:mean %) (:sd %))]
                           (if (neg? vmin)
                             0
                             vmin))
                        (mapcat vals (vals result)))
            :semax (map #(+ (:mean %) (:sd %)) (mapcat vals (vals result)))}]
   (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :hour :count]]
       [:geom_errorbar [:aes {:ymin :semin :ymax :semax }] {:width 0.68 :color "grey"}]
       [:geom_line {:stat "identity" :color "steelblue"}]
       [:geom_point {:color "steelblue"}]
       [:xlab "Time of day"]
       [:ylab "Average Latency in hours"]
       [:theme_bw]
       [:ggtitle "Replies latency time distribution"])]
    {:width 7
     :height 6}))
